import classes from "./RecentCard.module.css"

const typeData = [
    {
        text: "Family House",
        value: "Family House"
    },
    {
        text: "House & Villa",
        value: "House & Villa"
    },
    {
        text: "Apartment",
        value: "Apartment"
    },
    {
        text: "Office & Studio",
        value: "Office & Studio"
    },
    {
        text: "Villa & Condo",
        value: "Villa & Condo"
    },
    
]

const RecentCard = props => {
    return (
        <div className={`${classes.shadow}`} key={props.item.index}>
            <div className={classes.img}>
                <img src={props.item.cover} alt='' />
            </div>
            <div className={classes.text}>
                <div className={`${classes.category} ${classes.flex}`}>
                <span style={{ background: props.item.category === "For Sale" ? "#25b5791a" : "#ff98001a", color: props.item.category === "For Sale" ? "#25b579" : "#ff9800" }}>{typeData[props.item.category].text}</span>
                <i className='fa fa-heart'></i>
            </div>
            <h4>{props.item.room_name}</h4>
            <p>
                <i className='fa fa-location-dot'></i> {props.item.city}
            </p>
            </div>
            <div className={`${classes.button} ${classes.flex}`}>
                <div>
                    <button className={classes.btn2}>{props.item.price}</button> <label htmlFor=''>/month</label>
                </div>
                <span>{props.item.type}</span>
            </div>
        </div>
    )
}

export default RecentCard
